  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Morton
  National Wildlife Refuge  outlines Refuge accomplishments during the 1972 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, mammals, raptors, and reptiles-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, collections and receipts, and vegetation control. The public
  relations section of the report describes recreational uses, Refuge visitors, Refuge
  participation, violations, and safety. Items of interest, N-R forms, photographs,
  and newspaper articles are included.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
